Sails-mongo adapter: Unexpected error from database adapter: Invalid primary key value provided for `id`. Cannot interpret `94...` as a Mongo id<p>My sails application works well while connected to mysql database. I however had the need to switch to mongoDB as it is a requirement for the project and here comes the issues I face. </p>

<p>My models have some relationships for it to work and to achieve this, I had to make some modifications which include the following: I used <a href="https://www.npmjs.com/package/uuid" rel="nofollow noreferrer">uuid</a> to set the primary keys (id) for each model (The id was automatically generated by mysql before). When I however try to submit requests to the server I experience the error:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>AdapterError: Unexpected error from database adapter: Invalid primary key value provided for `id`.  Cannot interpret `9456b206-ebcf-4a6d-b81c-93964c027f04` as a Mongo id.
(Usually, this is the result of a bug in application logic.)</code></pre>
</div>
</div>
</p>

<p>Here is a sample of one of my models - picked.js:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>module.exports = {
  
  attributes: {
    userId: {
      type: 'string',
      required: true,
      //unique: true,
    },
    comment:{
      type: 'string',
      required: true
    },
    createdBy:{
      type: 'string',
      required: true
    },
    info: {
      model: 'personalinfo' 
    },
    admin: {
      model: 'admin'
    },

    id:{
      type: 'string',
    },

  },

};</code></pre>
</div>
</div>
</p>

