How to make a global variable or be able to access it in other files<p>So I have a nodejs project where I have a dynamic form which expands if the user clicks "add question". This functionality is done by my createUX.js file which has a function that appends more divs to the html form on buttonclick. The file also keeps track of the number of questions in a variable. Now I would like to access this variable in my create.js file which actually adds the questions to my database so I know how many questions to add. My createUX.js file under my public dir while my create.js file is under my routes directory. How can I achieve this? I already tried exporting the variable but it gave me the starting value for the variable. I also tried importing the whole file into a var and calling .questionNum on the file. Thank you!</p>

