<pre><code>{ "_id" : 1, "name" : "value1", "x" : 1, "y" : 2 }
{ "_id" : 2, "name" : "value1", "x" : 2, "y" : 2 }
{ "_id" : 3, "name" : "value1", "z" : 10 }
{ "_id" : 4, "name" : "value1", "z" : 20 }
{ "_id" : 5, "name" : "value2", "x" : 8, "y" : 3 }
{ "_id" : 6, "name" : "value2", "x" : 8, "y" : 3 }
{ "_id" : 7, "name" : "value2", "z" : 15 }
</code></pre>

<p>Here, if I query based on <code>name</code>, take <code>value1</code>, then I should get the following single document.</p>

<pre><code>{ "name" : "value1", "x" : [ 1, 2 ], "y" : [ 2, 2 ], "z" : [ 10, 20 ] }
</code></pre>

<p>I think this has something to do with aggregation. But I have no idea how to do it. Is there any way to achieve this behavior?</p>; Answer: This is correct. Connection attempts do not time out (as stated in the Apple documentation: https://developer.apple.com/library/ios/documentation/CoreBluetooth/Reference/CBCentralManager_Class/#//apple_ref/occ/instm/CBCentralManager/connectPeripheral:options:).
Just be sure to also keep a reference to the peripheral object, otherwise the connection gets canceled.

